import { useLocation, useParams } from "react-router-dom";
import './Weather.css';

const Weather = () => {
    const {id}= useParams();
    useLocation();
    // const propsData = props.weatherInfoData;
    // console.log(propsData + 'dynamic routes data');
    return (
        <div>
            Hello from Weather {id}
        </div>
    );
}

export default Weather;
